import React from 'react'
import {Link} from 'react-router-dom'
import  './style.css';

export function FichaHome (){
    return(
        <div>
        <Link
        style={{ textDecoration: "none", color: "#000" }}
        to="/ficha"
      >
        <button id="margen-btn" type="button" class="btn btn-outline-success">
          Agregar ficha
        </button>
      </Link>

      <br />
      </div>

    );
}
